window.bookSummaryJSON = "<p>Hunter Hume was kicked from the Star Pilot’s Guild and now scrapes a living guiding rich clients onto unpopulated worlds to hunt the wildlife. When scouting a new world Hume spotted something unusual and saw an opportunity to make money. In a devilish deal with an underworld kingpin Hume leads a safari into the jungle world of Jumala and into a terrifying situation he never expected.&nbsp;</p> <p>FNH Audio presents an unabridged reading of Andre Norton’s classic science fiction tale of adventure.</p>"; 
